import React, { useState, useRef } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

// Enhanced Virtual Dyno with Live Graphing
const VirtualDyno = () => {
  const [csvFile, setCsvFile] = useState(null);
  const [csvData, setCsvData] = useState([]);
  const [dynoResults, setDynoResults] = useState(null);
  const [isRunning, setIsRunning] = useState(false);
  const [currentDataPoint, setCurrentDataPoint] = useState(0);
  const [liveGraphData, setLiveGraphData] = useState([]);
  const [currentPeaks, setCurrentPeaks] = useState({
    maxHP: 0,
    maxTorque: 0,
    maxBoost: 0,
    currentHP: 0,
    currentTorque: 0,
    currentBoost: 0
  });
  const [selectedCar, setSelectedCar] = useState('mazdaspeed3');
  const [virtualDynoSettings, setVirtualDynoSettings] = useState({
    dynoType: 'mustang_md250',
    temperature: 75,
    humidity: 45,
    altitude: 500
  });
  const fileInputRef = useRef(null);

  // Dyno characteristics
  const dynoTypes = {
    mustang_md250: {
      name: "Mustang MD250 (Load Bearing)",
      correction: 1.0,
      variance: 0.02
    },
    dynojet_248c: {
      name: "DynoJet 248C (Inertial)", 
      correction: 1.15,
      variance: 0.03
    },
    awd_dyno: {
      name: "AWD Dyno (All-Wheel)",
      correction: 0.95,
      variance: 0.04
    }
  };

  // Parse uploaded CSV file
  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (!file) return;
    
    setCsvFile(file);
    
    const reader = new FileReader();
    reader.onload = (e) => {
      const csv = e.target.result;
      const lines = csv.split('\n');
      const headers = lines[0].split(',').map(h => h.trim());
      
      const data = lines.slice(1)
        .filter(line => line.trim().length > 0)
        .map(line => {
          const values = line.split(',');
          const row = {};
          headers.forEach((header, index) => {
            row[header] = values[index]?.trim();
          });
          return row;
        })
        .filter(row => {
          const rpm = parseInt(row['RPM (RPM)'] || row['RPM'] || row['Engine Speed']);
          const maf = parseFloat(row['Mass Airflow (g/s)'] || row['MAF'] || row['Mass Airflow']);
          const load = parseFloat(row['Calculated Load (Load)'] || row['Load'] || row['Engine Load']);
          
          return rpm > 2000 && maf > 5 && load > 0.15;
        });
      
      setCsvData(data);
      console.log(`Loaded ${data.length} valid data points from CSV`);
    };
    
    reader.readAsText(file);
  };

  // Send to C# backend
  const sendToBackend = async () => {
    if (!csvFile) return null;
    
    try {
      const formData = new FormData();
      formData.append('File', csvFile);
      formData.append('CarPresetKey', selectedCar);
      formData.append('Weight', '3200');
      formData.append('Gear', '4');
      formData.append('Notes', `Virtual dyno: ${virtualDynoSettings.dynoType}, ${virtualDynoSettings.temperature}Â°F`);
      formData.append('IsPublic', 'false');
      
      console.log('Sending CSV to C# backend...');
      const response = await fetch('http://localhost:5038/api/dyno/upload', {
        method: 'POST',
        body: formData
      });
      
      if (response.ok) {
        const backendResults = await response.json();
        console.log('âœ… C# Backend Results:', backendResults);
        return backendResults;
      } else {
        console.error('Backend API error:', response.status, response.statusText);
        return null;
      }
    } catch (error) {
      console.error('Failed to connect to C# backend:', error);
      return null;
    }
  };

  // Enhanced dyno run with live graphing
  const runVirtualDyno = async () => {
    if (!csvData.length) {
      alert('Please upload a CSV file first!');
      return;
    }
    
    setIsRunning(true);
    setCurrentDataPoint(0);
    setLiveGraphData([]);
    setCurrentPeaks({
      maxHP: 0,
      maxTorque: 0,
      maxBoost: 0,
      currentHP: 0,
      currentTorque: 0,
      currentBoost: 0
    });
    
    try {
      // Get backend results
      const backendResults = await sendToBackend();
      
      if (!backendResults) {
        alert('Could not connect to backend API. Make sure your C# API is running on localhost:5038');
        setIsRunning(false);
        return;
      }
      
      // Get detailed data points
      const detailResponse = await fetch(`http://localhost:5038/api/dyno/runs/${backendResults.id}`);
      
      if (!detailResponse.ok) {
        console.error('Failed to get detailed run data:', detailResponse.status);
        setIsRunning(false);
        return;
      }
      
      const detailData = await detailResponse.json();
      
      // Process data with virtual dyno characteristics
      const processedData = (detailData.dataPoints || []).map((point, index) => {
        const dyno = dynoTypes[virtualDynoSettings.dynoType];
        
        // Environmental effects
        const tempCorrection = Math.sqrt(537.67 / (virtualDynoSettings.temperature + 459.67));
        const humidityCorrection = 1 - (virtualDynoSettings.humidity / 100 * 0.047);
        const altitudeCorrection = 1 - (virtualDynoSettings.altitude * 0.000035);
        const envCorrection = tempCorrection * humidityCorrection * altitudeCorrection;
        
        // Dyno type correction and variance
        const variance = 1 + (Math.random() - 0.5) * 2 * dyno.variance;
        
        return {
          rpm: point.rpm || point.Rpm || 0,
          hp: (point.horsepower || point.Horsepower || 0) * envCorrection * dyno.correction * variance,
          torque: (point.torque || point.Torque || 0) * envCorrection * variance,
          boost: point.boost || point.Boost || 0,
          maf: point.massAirflow || point.MassAirflow || 0,
          load: point.load || point.Load || 0,
          backendHP: point.horsepower || point.Horsepower || 0,
          backendTorque: point.torque || point.Torque || 0
        };
      });
      
      // Sort by RPM for proper graph progression
      processedData.sort((a, b) => a.rpm - b.rpm);
      
      // Animate the dyno run with live graph updates
      for (let i = 0; i < processedData.length; i++) {
        const currentPoint = processedData[i];
        
        // Update live graph data (add current point)
        setLiveGraphData(prev => {
          const newData = [...prev, {
            rpm: currentPoint.rpm,
            horsepower: Math.round(currentPoint.hp * 10) / 10,
            torque: Math.round(currentPoint.torque * 10) / 10,
            boost: Math.round(currentPoint.boost * 10) / 10
          }];
          
          // Sort by RPM to ensure proper line drawing
          return newData.sort((a, b) => a.rpm - b.rpm);
        });
        
        // Update current peaks and live readings
        setCurrentPeaks(prev => {
          const graphData = liveGraphData.concat([{
            rpm: currentPoint.rpm,
            horsepower: currentPoint.hp,
            torque: currentPoint.torque,
            boost: currentPoint.boost
          }]);
          
          const maxHP = Math.max(prev.maxHP, currentPoint.hp);
          const maxTorque = Math.max(prev.maxTorque, currentPoint.torque);
          const maxBoost = Math.max(prev.maxBoost, currentPoint.boost);
          
          return {
            maxHP: Math.round(maxHP * 10) / 10,
            maxTorque: Math.round(maxTorque * 10) / 10,
            maxBoost: Math.round(maxBoost * 10) / 10,
            currentHP: Math.round(currentPoint.hp * 10) / 10,
            currentTorque: Math.round(currentPoint.torque * 10) / 10,
            currentBoost: Math.round(currentPoint.boost * 10) / 10
          };
        });
        
        setCurrentDataPoint(i);
        
        // Vary the delay based on RPM (faster at higher RPMs like a real dyno)
        const delay = currentPoint.rpm < 3000 ? 200 : 
                     currentPoint.rpm < 4000 ? 150 : 
                     currentPoint.rpm < 5000 ? 120 : 100;
        
        await new Promise(resolve => setTimeout(resolve, delay));
      }
      
      // Calculate final peaks
      const peaks = {
        maxHP: processedData.length > 0 ? Math.max(...processedData.map(d => d.hp || 0)) : 0,
        maxTorque: processedData.length > 0 ? Math.max(...processedData.map(d => d.torque || 0)) : 0,
        maxHPRpm: processedData.find(d => d.hp === Math.max(...processedData.map(p => p.hp || 0)))?.rpm || 0,
        maxTorqueRpm: processedData.find(d => d.torque === Math.max(...processedData.map(p => p.torque || 0)))?.rpm || 0,
        backendMaxHP: backendResults.peaks?.maxHorsepower || 0,
        backendMaxTorque: backendResults.peaks?.maxTorque || 0,
        backendMaxHPRpm: backendResults.peaks?.maxHorsepowerRpm || 0,
        backendMaxTorqueRpm: backendResults.peaks?.maxTorqueRpm || 0
      };
      
      setDynoResults({
        processedData,
        peaks,
        settings: virtualDynoSettings,
        fileName: csvFile.name,
        backendResults
      });
      
    } catch (error) {
      console.error('Error running virtual dyno:', error);
      alert('Error connecting to backend API. Make sure your C# API is running.');
    } finally {
      setIsRunning(false);
    }
  };

  // Reset dyno
  const resetDyno = () => {
    setDynoResults(null);
    setCurrentDataPoint(0);
    setLiveGraphData([]);
    setCurrentPeaks({
      maxHP: 0,
      maxTorque: 0,
      maxBoost: 0,
      currentHP: 0,
      currentTorque: 0,
      currentBoost: 0
    });
  };

  // Custom tooltip for the graph
  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      return (
        <div style={{
          backgroundColor: '#1a1a1a',
          border: '1px solid #333',
          borderRadius: '5px',
          padding: '10px',
          color: 'white'
        }}>
          <p style={{ margin: 0, fontWeight: 'bold' }}>{`${label} RPM`}</p>
          {payload.map((entry, index) => (
            <p key={index} style={{ margin: '2px 0', color: entry.color }}>
              {`${entry.name}: ${entry.value} ${entry.name === 'Horsepower' ? 'HP' : 
                entry.name === 'Torque' ? 'lb-ft' : 'PSI'}`}
            </p>
          ))}
        </div>
      );
    }
    return null;
  };

  return (
    <div style={{ padding: '20px', maxWidth: '1400px', margin: '0 auto', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ textAlign: 'center', color: '#333', marginBottom: '10px' }}>
        ðŸ Virtual Dyno Experience - Live Graphing
      </h1>
      
      <div style={{
        backgroundColor: '#d4edda',
        border: '1px solid #c3e6cb',
        padding: '10px',
        borderRadius: '5px',
        marginBottom: '20px',
        textAlign: 'center'
      }}>
        <strong>âš™ï¸ Make sure your C# backend is running:</strong> <code>cd VirtualDyno.API && dotnet run</code>
      </div>
      
      {/* Main Grid Layout */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: isRunning || dynoResults ? '1fr 2fr' : '1fr 1fr 1fr',
        gap: '20px',
        marginBottom: '20px'
      }}>
        
        {/* File Upload */}
        <div style={{
          border: csvFile ? '2px solid #28a745' : '2px dashed #007bff',
          padding: '20px',
          borderRadius: '8px',
          textAlign: 'center',
          backgroundColor: csvFile ? '#e8f5e8' : '#f8f9ff'
        }}>
          <h3 style={{ marginBottom: '15px', color: '#333' }}>ðŸ“ Upload Your Datalog</h3>
          <input 
            type="file" 
            accept=".csv"
            onChange={handleFileUpload}
            ref={fileInputRef}
            style={{ display: 'none' }}
          />
          <button 
            onClick={() => fileInputRef.current.click()}
            style={{
              padding: '10px 20px',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
              fontSize: '16px'
            }}
          >
            {csvFile ? 'âœ… Change File' : 'ðŸ“‚ Select CSV File'}
          </button>
          
          {csvFile && (
            <div style={{ marginTop: '10px', fontSize: '14px', color: '#666' }}>
              <p><strong>File:</strong> {csvFile.name}</p>
              <p><strong>Data Points:</strong> {csvData.length}</p>
            </div>
          )}
        </div>

        {/* Settings Panel */}
        {!isRunning && !dynoResults && (
          <div style={{
            border: '1px solid #ddd',
            padding: '15px',
            borderRadius: '8px',
            backgroundColor: '#f9f9f9'
          }}>
            <h3 style={{ marginBottom: '15px', color: '#333', borderBottom: '1px solid #ddd', paddingBottom: '5px' }}>
              ðŸš— Vehicle & Dyno Settings
            </h3>
            
            <label style={{ display: 'block', marginBottom: '5px', fontWeight: '500', color: '#555' }}>
              Select Car:
            </label>
            <select 
              value={selectedCar}
              onChange={(e) => {
                setSelectedCar(e.target.value);
                resetDyno();
              }}
              style={{
                width: '100%',
                margin: '5px 0 15px 0',
                padding: '5px',
                border: '1px solid #ddd',
                borderRadius: '3px'
              }}
            >
              <option value="mazdaspeed3">Mazdaspeed3</option>
              <option value="wrx">Subaru WRX</option>
              <option value="gti">VW GTI</option>
              <option value="focus_st">Ford Focus ST</option>
            </select>

            <label style={{ display: 'block', marginBottom: '5px', fontWeight: '500', color: '#555' }}>
              Dyno Type:
            </label>
            <select 
              value={virtualDynoSettings.dynoType}
              onChange={(e) => setVirtualDynoSettings(prev => ({
                ...prev, dynoType: e.target.value
              }))}
              style={{
                width: '100%',
                margin: '5px 0 15px 0',
                padding: '5px',
                border: '1px solid #ddd',
                borderRadius: '3px'
              }}
            >
              {Object.entries(dynoTypes).map(([key, dyno]) => (
                <option key={key} value={key}>{dyno.name}</option>
              ))}
            </select>
            
            <label style={{ display: 'block', marginBottom: '5px', fontWeight: '500', color: '#555' }}>
              Temperature: {virtualDynoSettings.temperature}Â°F
            </label>
            <input 
              type="range" 
              min="50" 
              max="110" 
              value={virtualDynoSettings.temperature}
              onChange={(e) => setVirtualDynoSettings(prev => ({
                ...prev, temperature: parseInt(e.target.value)
              }))}
              style={{ width: '100%', margin: '5px 0 15px 0' }}
            />
          </div>
        )}

        {/* Live Graph Area */}
        {(isRunning || dynoResults) && (
          <div style={{
            border: '2px solid #28a745',
            padding: '15px',
            borderRadius: '8px',
            backgroundColor: '#f8fff8'
          }}>
            {/* Peak Stats Card */}
            <div style={{
              backgroundColor: '#1a1a1a',
              color: 'white',
              padding: '15px',
              borderRadius: '8px',
              marginBottom: '15px',
              display: 'grid',
              gridTemplateColumns: '1fr 1fr 1fr',
              gap: '15px',
              textAlign: 'center'
            }}>
              <div>
                <div style={{ fontSize: '24px', fontWeight: 'bold', color: '#ff4444' }}>
                  {isRunning ? currentPeaks.currentHP : (dynoResults?.peaks?.maxHP || 0)}
                </div>
                <div style={{ fontSize: '12px', color: '#ccc' }}>
                  {isRunning ? 'CURRENT' : 'PEAK'} HP
                </div>
                {!isRunning && dynoResults && (
                  <div style={{ fontSize: '10px', color: '#888' }}>
                    @ {dynoResults.peaks?.maxHPRpm || 0} RPM
                  </div>
                )}
              </div>
              
              <div>
                <div style={{ fontSize: '24px', fontWeight: 'bold', color: '#44ff44' }}>
                  {isRunning ? currentPeaks.currentTorque : (dynoResults?.peaks?.maxTorque || 0)}
                </div>
                <div style={{ fontSize: '12px', color: '#ccc' }}>
                  {isRunning ? 'CURRENT' : 'PEAK'} LB-FT
                </div>
                {!isRunning && dynoResults && (
                  <div style={{ fontSize: '10px', color: '#888' }}>
                    @ {dynoResults.peaks?.maxTorqueRpm || 0} RPM
                  </div>
                )}
              </div>
              
              <div>
                <div style={{ fontSize: '24px', fontWeight: 'bold', color: '#4444ff' }}>
                  {isRunning ? currentPeaks.maxBoost : (Math.max(...(liveGraphData.map(d => d.boost) || [0])))}
                </div>
                <div style={{ fontSize: '12px', color: '#ccc' }}>
                  PEAK BOOST PSI
                </div>
                <div style={{ fontSize: '10px', color: '#888' }}>
                  {isRunning ? 'LIVE' : 'RECORDED'}
                </div>
              </div>
            </div>

            {/* Live Graph */}
            <div style={{ height: '400px', width: '100%' }}>
              <ResponsiveContainer width="100%" height="100%">
                <LineChart
                  data={liveGraphData}
                  margin={{ top: 20, right: 30, left: 20, bottom: 20 }}
                >
                  <CartesianGrid strokeDasharray="3 3" stroke="#333" />
                  <XAxis 
                    dataKey="rpm" 
                    stroke="#666"
                    label={{ value: 'RPM', position: 'insideBottom', offset: -10 }}
                  />
                  <YAxis 
                    stroke="#666"
                    label={{ value: 'HP / TQ', angle: -90, position: 'insideLeft' }}
                  />
                  <Tooltip content={<CustomTooltip />} />
                  <Legend />
                  <Line 
                    type="monotone" 
                    dataKey="horsepower" 
                    stroke="#ff4444" 
                    strokeWidth={3}
                    name="Horsepower"
                    dot={false}
                    connectNulls={false}
                  />
                  <Line 
                    type="monotone" 
                    dataKey="torque" 
                    stroke="#44ff44" 
                    strokeWidth={3}
                    name="Torque"
                    dot={false}
                    connectNulls={false}
                  />
                </LineChart>
              </ResponsiveContainer>
            </div>

            {isRunning && (
              <div style={{ textAlign: 'center', marginTop: '15px' }}>
                <div style={{
                  backgroundColor: '#ffeb3b',
                  padding: '10px',
                  borderRadius: '5px',
                  marginBottom: '10px'
                }}>
                  <div style={{ fontSize: '18px', fontWeight: 'bold' }}>
                    {liveGraphData[currentDataPoint]?.rpm || 0} RPM
                  </div>
                  <div style={{ fontSize: '14px' }}>
                    {currentPeaks.currentHP} HP | {currentPeaks.currentTorque} lb-ft | {currentPeaks.currentBoost} PSI
                  </div>
                </div>
                
                <div style={{
                  width: '100%',
                  height: '10px',
                  backgroundColor: '#ddd',
                  borderRadius: '5px',
                  overflow: 'hidden'
                }}>
                  <div style={{
                    height: '100%',
                    backgroundColor: '#28a745',
                    borderRadius: '5px',
                    width: `${csvData.length > 0 ? (currentDataPoint / csvData.length) * 100 : 0}%`,
                    transition: 'width 0.1s ease'
                  }}></div>
                </div>
              </div>
            )}
          </div>
        )}

        {/* Status/Results Panel */}
        {!isRunning && !dynoResults && (
          <div style={{
            border: '2px solid #28a745',
            padding: '15px',
            borderRadius: '8px',
            backgroundColor: '#f8fff8'
          }}>
            <h3 style={{ marginBottom: '15px', color: '#333' }}>Virtual Dyno</h3>
            
            {csvData.length > 0 ? (
              <div style={{
                backgroundColor: '#f8f9fa',
                padding: '10px',
                borderRadius: '5px',
                textAlign: 'center',
                fontSize: '14px'
              }}>
                <p><strong>Ready to Run!</strong></p>
                <p>CSV loaded with {csvData.length} data points</p>
                <p>Click "START VIRTUAL DYNO" to process with your C# backend</p>
              </div>
            ) : (
              <div style={{
                backgroundColor: '#f5f5f5',
                padding: '15px',
                borderRadius: '5px',
                textAlign: 'center',
                color: '#666'
              }}>
                <p>Upload a CSV file to get started</p>
              </div>
            )}
          </div>
        )}
      </div>

      {/* Control Buttons */}
      <div style={{ textAlign: 'center', marginBottom: '20px' }}>
        <button 
          onClick={runVirtualDyno}
          disabled={!csvData.length || isRunning}
          style={{
            padding: '15px 30px',
            backgroundColor: isRunning ? '#ccc' : '#dc3545',
            color: 'white',
            border: 'none',
            borderRadius: '8px',
            fontSize: '18px',
            fontWeight: 'bold',
            marginRight: '10px',
            cursor: isRunning ? 'not-allowed' : 'pointer'
          }}
        >
          {isRunning ? 'ðŸƒ PROCESSING...' : `ðŸš€ START VIRTUAL DYNO`}
        </button>
        
        {(dynoResults || liveGraphData.length > 0) && !isRunning && (
          <button 
            onClick={resetDyno}
            style={{
              padding: '10px 20px',
              backgroundColor: '#6c757d',
              color: 'white',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer'
            }}
          >
            ðŸ”„ Reset
          </button>
        )}
      </div>

      {/* Final Results */}
      {dynoResults && !isRunning && (
        <div style={{
          padding: '20px',
          backgroundColor: '#e3f2fd',
          borderRadius: '8px',
          marginTop: '20px'
        }}>
          <h4 style={{ color: '#333', marginBottom: '15px' }}>ðŸ† Final Dyno Results</h4>
          
          <div style={{
            display: 'grid',
            gridTemplateColumns: '1fr 1fr',
            gap: '20px'
          }}>
            <div style={{
              backgroundColor: '#e8f5e8',
              padding: '15px',
              borderRadius: '5px'
            }}>
              <h5>Virtual Dyno Results</h5>
              <p><strong>{(dynoResults.peaks?.maxHP || 0).toFixed(1)} HP</strong> @ {dynoResults.peaks?.maxHPRpm || 'N/A'} RPM</p>
              <p><strong>{(dynoResults.peaks?.maxTorque || 0).toFixed(1)} lb-ft</strong> @ {dynoResults.peaks?.maxTorqueRpm || 'N/A'} RPM</p>
              <p style={{ fontSize: '12px', color: '#666', lineHeight: 1.4 }}>
                Dyno: {dynoTypes[dynoResults.settings?.dynoType]?.name || 'Unknown'}<br/>
                Conditions: {dynoResults.settings?.temperature || 'N/A'}Â°F, {dynoResults.settings?.humidity || 'N/A'}% humidity
              </p>
            </div>
            
            <div style={{
              backgroundColor: '#e3f2fd',
              padding: '15px',
              borderRadius: '5px'
            }}>
              <h5>C# Backend Results</h5>
              <p><strong>{(dynoResults.peaks?.backendMaxHP || 0).toFixed(1)} HP</strong> @ {dynoResults.peaks?.backendMaxHPRpm || 'N/A'} RPM</p>
              <p><strong>{(dynoResults.peaks?.backendMaxTorque || 0).toFixed(1)} lb-ft</strong> @ {dynoResults.peaks?.backendMaxTorqueRpm || 'N/A'} RPM</p>
              <p style={{ fontSize: '12px', color: '#666' }}>
                <em>(Raw calculations before virtual dyno effects)</em>
              </p>
            </div>
          </div>
        </div>
      )}

      {/* Instructions */}
      <div style={{
        padding: '20px',
        backgroundColor: '#e3f2fd',
        borderRadius: '8px',
        marginTop: '20px'
      }}>
        <h4 style={{ color: '#333', marginBottom: '15px' }}>ðŸŽ® How to Use Your Virtual Dyno:</h4>
        <ol style={{ marginBottom: '15px', paddingLeft: '20px' }}>
          <li style={{ marginBottom: '8px', lineHeight: 1.4 }}>
            <strong>Upload your real CSV datalog</strong> (AccessPort, Cobb, MHD, etc.)
          </li>
          <li style={{ marginBottom: '8px', lineHeight: 1.4 }}>
            <strong>Choose your vehicle and dyno type</strong> - Different dynos read differently
          </li>
          <li style={{ marginBottom: '8px', lineHeight: 1.4 }}>
            <strong>Watch the live graph build your power curves</strong> - Just like a real dyno!
          </li>
          <li style={{ marginBottom: '8px', lineHeight: 1.4 }}>
            <strong>See peak values update in real-time</strong> - HP, Torque, and Boost
          </li>
          <li style={{ marginBottom: '8px', lineHeight: 1.4 }}>
            <strong>Compare virtual vs. backend results</strong> - See how dyno conditions affect readings
          </li>
        </ol>
        
        <p><strong>ðŸŽ¯ Features authentic dyno experience:</strong> Progressive graph building, live peak tracking, environmental corrections, and dyno-specific variance!</p>
      </div>
    </div>
  );
};

export default VirtualDyno;
